import React, { useState } from "react";

function TodoList({ todos }) {
  return (
    <div>
      <form>
        <input
          type="text"
          placeholder="Write What to do and Press Enter."
          required
          //   onSubmit={}
        ></input>
        <ul>
          {todos.map((todo, index) => (
            <span>
              <li key={index}>{todo}</li>
              <button>x</button>
            </span>
          ))}
        </ul>
      </form>
    </div>
  );
}

export default TodoList;
